import css from "./styles.scss";

const CardProfile = ({ profile }) => {
	console.log(profile);
	return (
		<div className={css.profile}>
			<Link><img src={profile.avatar} title={profile.name}></img></Link>
			<p>{profile.name}</p>
		</div>
	);
}

export default CardProfile;
